import React from "react";


class PhaseStateLegend extends React.Component {
    constructor(props) {
        super(props);
    }

    render() {
        return (
            <div id="phaseStateLegend" className="floatLeft">
                <div className="phaseSymbolOuterDiv">
                    <span id="solidLegend" className="phaseSymbol centered">
                        S
                    </span>

                    <span>
                    </span>
                </div>

                <div className="phaseSymbolOuterDiv">
                    <span id="liquidLegend" className="phaseSymbol centered">
                        L
                    </span>
                </div>

                <div className="phaseSymbolOuterDiv">
                    <span id="gasLegend" className="phaseSymbol centered">
                        G
                    </span>
                </div>

                <div className="phaseSymbolOuterDiv">
                    <span id="unknownLegend" className="phaseSymbol centered">
                        Uk
                    </span>
                </div>
            </div>
        );
    }
}


export default PhaseStateLegend;
